import React, { Component } from "react";
import NavComplete from "../components/navcomplete";

class AboutPage extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavComplete />
        <div style={{ display: "grid", gridTemplateColumns: "500px 500px" }}>
          <div
            style={{
              display: "grid",
              gridTemplateRows: "0px",
              margin: 20,
            }}
          >
            <div
              style={{
                maxWidth: 400,
                height: 200,
                width: "auto",
                backgroundColor: "black",

                backgroundColor: "rgb(181, 119, 0)",
              }}
            ></div>
            <div
              style={{
                maxWidth: 400,
                height: 200,
                width: "auto",
                backgroundColor: "rgb(255, 203, 105)",
                margin: 10,
                fontFamily: "Unna",
                fontSize: 70,
                fontWeight: "bold",
                display: "grid",
                alignContent: "center",
                justifyContent: "center",
              }}
            >
              <div style={{}}>
                <div style={{ alignContent: "center" }}>Vivan</div>
                <div style={{ alignContent: "center" }}>Marwaha</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default AboutPage;
